import React, { useEffect } from "react";

const PrethodnePorudzbine=()=>{

    useEffect(()=> {
        fetch('https://localhost:44388/Porudzbina/allPorudzbine', {
            method: 'GET',
            hheaders: {
                'Content-Type': 'application/json',
            },
            mode:'cors',
        })
        .then((responce)=>responce.json())
        .then((data)=>{
            //obrada odgovora servera 
            console.log(data);
        })
        .catch((error)=>{
            console.error("Greška prilikom dobavljanja podataka sa servera:", error);
        });
    }, []);

    return(
        <div>
            <h1>PrethodnePorudzbine</h1>
            <table>
                <tr>
                    <th>Vreme isporuke</th>
                    <th>Adresa dostave</th>
                    <th>Artikli</th>
                    <th>Komentar</th>
                </tr>
            </table>
        </div>
    );
};

export default PrethodnePorudzbine;
